import React from 'react';
import {BrowserRouter as Router, Routes} from 'react-router-dom'
import './App.css';

import Login from './components/Login';
import Register from './components/Register';

function App() {
  return (
      <Router>
        <Login/>
        <Route path="/" exact element={Login} />
      </Router> 
  );
}

export default App;
